function findDeckInstance() {
    for (const key in window) {
        const obj = window[key];
        if (obj && typeof obj === "object" &&
            obj.constructor && obj.constructor.name.includes("Deck")) {
            return obj;
        }
    }
    return null;
}

function formatTable(rows) {
    if (!rows.length) return "<b>No records for this ZIP</b>";
    let html = "<h3>Records</h3>";
    html += "<table border='1' cellspacing='0' cellpadding='4' style='width:100%; font-size:12px'>";
    html += "<tr><th>City</th><th>State</th><th>Employer</th><th>Job</th><th>Start</th><th>End</th></tr>";
    rows.forEach(r => {
        html += `<tr>
            <td>${r.Employer_City}</td>
            <td>${r.Employer_State}</td>
            <td>${r.Employer_Name}</td>
            <td>${r.Job_Title}</td>
            <td>${r.Authorization_Start_Date}</td>
            <td>${r.Authorization_End_Date}</td>
        </tr>`;
    });
    html += "</table>";
    return html;
}

function setupClick() {
    const deck = findDeckInstance();
    if (!deck) {
        setTimeout(setupClick, 200);
        return;
    }

    deck.setProps({
        onClick: info => {
            if (info && info.object) {
                const zip = info.object.zip;
                const rows = zipData.filter(r => r.Employer_Zip_Code === zip);

                const box = document.getElementById('zip-table-box');
                box.innerHTML = `<h2>ZIP $<class 'zip'></h2>` + formatTable(rows);
                box.style.display = "block";
            }
        }
    });
}

setupClick();
</script>
